import Typography from "@mui/material/Typography";
import hero from "./assets/images/hero.jpg";
import BrowseArtist from "../components/BrowseArtist/BrowseArtist";

const Home = () => {
  return (
    <div className="home">
      <img src={hero} />
      <div className="home__hero">
        <Typography
          variant="h4"
          sx={{ fontFamily: "Arial", color: "white", mb: 2 }}
        >
          Unleash Music's Hidden Gems with DiscoverUs
        </Typography>
        <Typography variant="h7" component="p">
          <Typography
            variant="h5"
            sx={{ fontFamily: "Arial", color: "white", mb: 2 }}
          >
            Scout, Listen or collboarte with new unsigned emerging
          </Typography>
          <div
            className="button-wrapper"
            style={{ display: "flex", gap: "52px", flexDirection: "row" }}
          >
            <Link to="/browse">
              <button className="header__button">Scout</button>
            </Link>
            <Link to="/signup">
              <button className="header__button">SignUp</button>
            </Link>
          </div>
          <signUp />
        </Typography>
      </div>
      <div className="home__artist">
        <BrowseArtist />
      </div>
      <div className="home__closing"></div>
      <main className="home__content"></main>
    </div>
  );
};

export default Home;
